import React from "react";

export const Pagination = ({ page, setpage, len }) => {
  const arr = [...Array(3)];
  return (
    <div>
      {page}
      <button
        onClick={() => {
          if (page > 1) setpage((prev) => prev - 1);
        }}
      >
        PREV
      </button>
      <button
        onClick={() => {
          if (page < len) setpage((prev) => prev + 1);
        }}
      >
        PREV
      </button>
    </div>
  );
};
